import bulkImages from './components/bulkImages';
import './App.css';

function App() {
  return (
    <div className='main'>
      {bulkImages.map((img) => (
        <img key={img} src={img} alt={img} className="bulkImage" />
      ))}
    </div>
  );
}

export default App;
